import React from 'react';
import InfoBox from '../components/InfoBox';

export default function LoginPage() {
  return (
    <div>
      <h1
        style={{ marginLeft: '30px', marginTop: '30px', letterSpacing: '2px' }}
      >
        이메일과 비밀번호를
        <br />
        입력해주세요
      </h1>
    </div>
  );
}
